const App = ()=>{
    return(
        <div id="container">
            <p>React Calculator</p>
            <input type="text" placeholder="Num 1" id="num1"/>
            <br />
            <input type="text" placeholder="Num 2" id="num2"/>
            <br />
            <button class="btn" id="add">+</button>
            <button class="btn btn2" id="sub">-</button>
            <button class="btn btn2" id="mul">*</button>
            <button class="btn btn2" id="div">/</button>
        </div>
    )
}

export default App;
